import React from "react";
import { Link } from "react-router-dom";

const NavLinkComponent = (props) => {
  const { name, path, linkRef } = props;
  return (
    <div className="nav-link-component">
      <Link to={`${path}`}>
        <li className="nav-link" ref={(li) => (linkRef = li)}>
          {name}
        </li>
      </Link>
    </div>
  );
};

export default NavLinkComponent;
